Correlation_Coeffici_1.query:
q = load "Regression_Analysis";
q = group q by (Record_Id, xVar);
q = foreach q generate Record_Id, xVar, max(x) - avg(max(x)) over ([..] partition by xVar) as xv, max(z) - avg(max(z)) over ([..] partition by xVar) as zv;
q = foreach q generate Record_Id, xVar, xv * xv as sx, zv * zv as sz, xv * zv as cov_xz;
q = group q by xVar;
q = foreach q generate xVar, sum(cov_xz) / (sqrt(sum(sx)) * sqrt(sum(sz))) as rxz;
q = order q by rxz desc;

