Pearson_Triangle.query:
q = load "Multivariate_Analysis";
q = group q by (Record_Id, xVar, yVar);
q = foreach q generate Record_Id, xVar, yVar, first(x) - average(first(x)) over ([..] partition by (xVar, yVar)) as var_x, first(y) - average(first(y)) over ([..] partition by (xVar, yVar)) as var_y, case when xVar < yVar then 1 else 0 end as doFilter;
q = filter q by doFilter == 1;
q = foreach q generate xVar, yVar, var_x * var_y as cov_xy, var_x * var_x as var_xs, var_y * var_y as var_ys;
q = group q by (xVar, yVar);
q = foreach q generate xVar, yVar, sum(cov_xy) / (sqrt(sum(var_xs)) * sqrt(sum(var_ys))) as cov_xy;

