q = group q by (Record_Id, xVar);
q = foreach q generate Record_Id, xVar, first(x) - average(first(x)) over ([..] partition by xVar) as xDev, first(z) - average(first(z)) over ([..] partition by xVar) as zDev;
q = foreach q generate Record_Id, xVar, xDev, zDev, xDev * zDev as cov;
