Histogram_1.query:
q = load "Regression_Analysis";
q = group q by (Record_Id, Input_Type, Input_Category);
q = foreach q generate Record_Id, Input_Type, Input_Category, max(x) as x, min(max(x)) over ([..] partition by all) as xMin, max(max(x)) over ([..] partition by all) as xMax;
q = foreach q generate Record_Id, Input_Type, Input_Category, x, xMin, xMax, trunc((xMax - xMin) / 20, 1) as span;
q = foreach q generate Record_Id, Input_Type, Input_Category, x, xMin, span, floor((x - xMin) / span) * span + xMin as Bottom;
q = foreach q generate Record_Id, Input_Type, Input_Category, x, xMin, Bottom, Bottom + span as Top;
q = foreach q generate Record_Id, Input_Type, Bottom, case when Input_Type == "Categorical" then Input_Category else number_to_string(Bottom, "0") + " - " + number_to_string(Top, "0") end as Input_Category;
q = group q by (Input_Category, Input_Type);
q = foreach q generate Input_Category, Input_Type, unique(Record_Id) as 'A', case when Input_Type == "Categorical" then 0 - unique(Record_Id) else max(Bottom) end as O;
q = group q by 'Input_Category';
q = foreach q generate 'Input_Category', first(A) as 'A', sum(sum(A)) over ([..0] partition by all order by (sum(O))) as 'B', sum(sum(A)) over ([..] partition by all) as D, sum(O) as O;
q = foreach q generate Input_Category, A as Claim_Count, B / D as Paretto, O;
q = order q by O;
q = limit q 2000;

