q = foreach q generate Record_Id, xVar, Input_Category, Input_Type, max(Data_Quality) as Data_Quality, max(x) - avg(max(x)) over ([..] partition by xVar) as xv, max(z) - avg(max(z)) over ([..] partition by xVar) as zv, count() over ([..] partition by (xVar, Input_Category)) as catCount, count() over ([..] partition by xVar) as totCount;
q = foreach q generate Record_Id, xVar, Input_Type, Input_Category, Data_Quality, xv * xv as sx, zv * zv as sz, xv * zv as cov_xz, catCount, totCount;
