q = foreach q generate xVar, first(Input_Type) as Input_Type, sum(cov_xz) / (sqrt(sum(sx)) * sqrt(sum(sz))) as rxz, unique(Input_Category) as Cardinality, avg(Data_Quality) as Data_Quality, max(catCount) as catCount, max(totCount) as totCount, floor(max(totCount) / unique(Input_Category)) as expCount;
q = foreach q generate xVar, Input_Type, rxz, Data_Quality, Cardinality, 1 - (catCount - expCount) / (totCount - expCount) as Dispursion;
