Covariance_2.query:
q = load "Multivariate_Analysis";
q = group q by (Record_Id, xVar, yVar);
--=========  Standardize data: subtract mean and divide by standard deviation
q = foreach q generate Record_Id, xVar, yVar, first(x) - average(first(x)) over ([..] partition by (xVar, yVar)) as var_x, first(y) - average(first(y)) over ([..] partition by (xVar, yVar)) as var_y, count() over ([..] partition by (xVar, yVar)) as n;
q = foreach q generate Record_Id, xVar, yVar, var_x, var_y, var_x * var_x as xx, var_y * var_y as yy, n;
q = group q by (Record_Id, xVar, yVar);
q = foreach q generate Record_Id, xVar, yVar, first(var_x) / sqrt(sum(first(xx)) over ([..] partition by (xVar, yVar)) / first(n)) as x, first(var_y) / sqrt(sum(first(yy)) over ([..] partition by (xVar, yVar)) / first(n)) as y;
--=========  Calculate covariance
q = foreach q generate Record_Id, xVar, yVar, x * y as cov;
q = group q by (xVar, yVar);
q = foreach q generate xVar, yVar, sum(cov) / count() as cov;
q = filter q by cov is not null;

